import React, { Component } from 'react'
import {Form,Button} from 'react-bootstrap'
import {login} from './../../service/LoginService'

export default class Login extends Component {

    constructor(props) {
        super(props)

        this.state = {
            user:{
             username:"",
             password:""
            }
        }
    }

    LoginHandleChange =(e)=>{
        const user = {...this.state.user}
        user[e.currentTarget.name]= e.currentTarget.value;
        this.setState({user})
    }


    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-6"></div>
                    <div className="col-6">
                    <Form>
                        <Form.Group controlId="formBasicEmail">
                            <Form.Label>Email address</Form.Label>
                            <Form.Control type="username" 
                            placeholder="Enter User Name"  
                            name="username" value={this.state.user.username} onChange={this.LoginHandleChange}/>
                            <Form.Text className="text-muted">
                            We'll never share your email with anyone else.
                            </Form.Text>
                        </Form.Group>

                        <Form.Group controlId="formBasicPassword">
                            <Form.Label>Password</Form.Label>
                            <Form.Control type="password" placeholder="Password" name="password" value={this.state.user.password} onChange={this.LoginHandleChange}/>
                        </Form.Group>

                        <Button variant="primary" type="submit" className="btn-block btn-info">
                            Login
                        </Button>
                    </Form>
                    </div>

                </div>

            </div>
        )
    }
}
